        shadowRadius: 15,
        padding: 30,
        minHeight: "75%",
        marginTop: 15,
        borderTopLeftRadius: 0,
    },
    materialStackedLabelTextbox1: {
        height: 60,
        width: 483,
    },
    materialStackedLabelTextbox2: {
